pragma solidity ^0.5.0;

contract MarketApp {
    address owner; // 
    uint256 public numItems; // 
    bool public stopped; // true
    uint256 public total_entry; // eth
    uint256 public bonus_eth; // ether

    // 
    constructor() public {
        owner = msg.sender; // 
        numItems = 0;
        stopped = false;
        total_entry = 0;
        bonus_eth = 0;
    }

    // 
    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    // Eth
    modifier onlyUser {
        require(accounts[msg.sender].resistered);
        _;
    }

    // ===========================
    // 
    // ===========================

    // 
    struct account {
        string name; //
        string email; //Email
        uint256 numTransactions; //
        int256 reputations; //
        bool resistered; //:false, :true
        int256 numSell; //
        int256 numBuy; //
        bool entryed; // false, true
    }

    address[] public users; // 

    mapping(address => account) accounts;

    mapping(address => uint256[]) public sellItems;
    mapping(address => uint256[]) public buyItems;

    // 
    function registerAccount(string memory _name, string memory _email)
        public
        returns (bool)
    {
        //
        if (!isUserExist(msg.sender)) {
            accounts[msg.sender].resistered = true;
            users.push(msg.sender);
        }
        accounts[msg.sender].name = _name;
        accounts[msg.sender].email = _email;
        return true;
    }

    // 
    function isUserExist(address user) public view returns (bool) {
        for (uint256 i = 0; i < users.length; i++) {
            if (users[i] == user) {
                return true;
            }
        }
        return false;
    }

    // 
    function viewAccount(address user)
        public
        view
        returns (string memory, string memory)
    {
        string memory _name = accounts[user].name;
        string memory _email = accounts[user].email;

        return (_name, _email);
    }

    // 
    function viewAccount_Transaction(address user)
        public
        view
        returns (
            uint256,
            int256,
            int256,
            int256
        )
    {
        uint256 _numTransactions = accounts[user].numTransactions;
        int256 _reputations = accounts[user].reputations;
        int256 _numSell = accounts[user].numSell;
        int256 _numBuy = accounts[user].numBuy;

        return (_numTransactions, _reputations, _numSell, _numBuy);
    }

    // 
    struct item {
        address payable sellerAddr; // Eth
        address payable buyerAddr; // Eth
        string seller; // 
        string name; // 
        string description; // 
        uint256 price; // (wei)
        bool payment; // false:, true:
        bool shipment; // false:, true:
        bool receivement; // false:, true:
        bool sellerReputate; // , false:, true:
        bool buyerReputate; // , false:, true:
        bool stopSell; // false:, true:
    }
    mapping(uint256 => item) public items;

    // 
    // solidity12item
    // images
    struct image {
        string googleDocID; // googleid
        string ipfsHash; // IPFS
    }
    mapping(uint256 => image) public images;

    // 
    function sell(
        string memory _name,
        string memory _description,
        uint256 _price,
        string memory _googleDocID,
        string memory _ipfsHash
    ) public onlyUser isStopped {
        items[numItems].sellerAddr = msg.sender; // Eth
        items[numItems].seller = accounts[msg.sender].name; // 
        items[numItems].name = _name; // 
        items[numItems].description = _description; // 
        items[numItems].price = _price; // 
        images[numItems].googleDocID = _googleDocID; // googleid
        images[numItems].ipfsHash = _ipfsHash; // IPFS
        accounts[msg.sender].numSell++; // 
        sellItems[msg.sender].push(numItems); // 
        numItems++; // 
    }

    // 
    // 
    function buy(uint256 _numItems) public payable onlyUser isStopped {
        require(!items[_numItems].payment); // 
        require(!items[_numItems].stopSell); // 

        require(items[_numItems].price == msg.value); // 

        items[_numItems].payment = true; // 
        items[_numItems].stopSell = true; // 
        items[_numItems].buyerAddr = msg.sender; // Eth
        accounts[msg.sender].numBuy++; // 
        buyItems[msg.sender].push(_numItems); // 
    }

    // 
    function ship(uint256 _numItems) public onlyUser isStopped {
        require(items[_numItems].sellerAddr == msg.sender); // 
        require(items[_numItems].payment); // 
        require(!items[_numItems].shipment); // 

        items[_numItems].shipment = true; // 
    }

    // 
    function receive(uint256 _numItems) public payable onlyUser isStopped {
        require(items[_numItems].buyerAddr == msg.sender); // 
        require(items[_numItems].shipment); // 
        require(!items[_numItems].receivement); // 

        items[_numItems].receivement = true; // 

        uint256 money = (items[_numItems].price * 4) / 5; // 20%
        bonus_eth = (items[_numItems].price * 1) / 5; // 20%bonus_eth

        // 
        items[_numItems].sellerAddr.transfer(money);
    }

    // 
    // 
    function sellerEvaluate(uint256 _numItems, int256 _reputate)
        public
        onlyUser
        isStopped
    {
        require(items[_numItems].buyerAddr == msg.sender); // 
        require(items[_numItems].receivement); // 
        require(_reputate >= 1 && _reputate <= 3); // 1 ~ 3
        require(!items[_numItems].sellerReputate); // 

        items[_numItems].sellerReputate = true; // 
        accounts[items[_numItems].sellerAddr].numTransactions++; // 
        accounts[items[_numItems].sellerAddr].reputations += _reputate; // 
    }

    // 
    function buyerEvaluate(uint256 _numItems, int256 _reputate)
        public
        onlyUser
        isStopped
    {
        require(items[_numItems].sellerAddr == msg.sender); // 
        require(items[_numItems].receivement); // 
        require(_reputate >= 1 && _reputate <= 3); // 1 ~ 3
        require(!items[_numItems].buyerReputate); // 

        items[_numItems].buyerReputate = true; // 
        accounts[items[_numItems].buyerAddr].numTransactions++; // 
        accounts[items[_numItems].buyerAddr].reputations += _reputate; // 
    }

    // ================
    // Eth
    // ================

    // eth
    struct get_eth_account {
        address payable entryAddr; // Eth
        string name; //
        string email; //Email
    }

    mapping(uint256 => get_eth_account) public get_eth_accounts;

    // eth_get
    function entry_get_eth() public onlyUser isStopped {
        // 
        require(!accounts[msg.sender].entryed);
        require(accounts[msg.sender].numTransactions >= 1); // 1

        get_eth_accounts[total_entry].entryAddr = msg.sender; //
        get_eth_accounts[total_entry].name = accounts[msg.sender].name; //
        get_eth_accounts[total_entry].email = accounts[msg.sender].email; //
        accounts[msg.sender].entryed = true;
        total_entry++;
    }

    // 
    function view_eth_acc(address user) public view returns (uint256, bool) {
        uint256 _entry_condition1 = accounts[user].numTransactions;
        bool _entry_condition2 = accounts[user].entryed;

        return (_entry_condition1, _entry_condition2);
    }

    // 
    // function random() private view returns (uint256) {
    //     return
    //         uint256(
    //             keccak256(abi.encodePacked(block.difficulty, now, msg.sender))
    //         );
    // }

    // function randMod(uint _randNonce, uint _modulus) public view returns(uint) {
    //     return uint(keccak256(abi.encodePacked(now, msg.sender, _randNonce))) % _modulus;
    // }

    // 
    function random() internal view returns (uint256) {
        uint256 randnum = block.timestamp % total_entry;

        return uint256(randnum);
    }

    // eth
    function get_eth() public payable onlyOwner isStopped {
        require(bonus_eth >= 1 ether);

        uint256 idx = random();
        get_eth_accounts[idx].entryAddr.transfer(bonus_eth);
        bonus_eth = 0;
        total_entry = 0;
        entry_false();
    }

    // false
    function entry_false() internal onlyOwner isStopped returns (uint256) {
        for (uint256 i = 0; i < users.length; i++) {
            address index = users[i];
            if (accounts[index].entryed) {
                accounts[index].entryed = false;
            }
        }
    }

    // ================
    // 
    // ================

    // Circuit Breaker
    modifier isStopped {
        require(!stopped);
        _;
    }

    // Circuit Breaker
    function toggleCircuit(bool _stopped) public onlyOwner {
        stopped = _stopped;
    }

    // 
    // 
    // function kill() public onlyOwner {
    //     selfdestruct(owner);
    // }
}
